export default function Contact(props){
    let contact=props.content;
    return (
        <>
            <div className="flex p-3 rounded-md  bg-white" id="contact" style="{boxShadow: '2px 2px 10px lightgray, inset 2px 2px 10px #c4cef3;'}">
                <div className="h-100 relative w-1/2">
                    {/* <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaUanxBSPWKztUx51vuqzmY9K0jqg3k5jERW9TJm3yu2sj54zF3kL-z8LIS_21sw4vWQ0&usqp=CAU" className="bgImageClass"></img> */}
                    <img src="https://images.template.net/78027/Free-Contact-Us-Illustration-JPEG-1.jpg" className="contactImg rounded-md"></img>
                </div>
                <div className="w-1/2 p-8">
                {
                    contact.map((el)=>(
                        <div class="mb-4">
                            <label for="name" className="block text-md font-bold text-indigo-900 mb-1">{el.label}</label>
                            <InputClass content={el}></InputClass>
                        </div>
                    ))
                }
                    <div className="text-center">
                        <button className="px-6 py-2 bg-indigo-900 text-white rounded-xl shadow hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-400 focus:ring-offset-1 transition">Submit</button>
                    </div>
                </div>
            </div>
        </>
    )
}

export function InputClass(props){
    const field=props.content;
    return (field.inputType!='textarea'?<input type={field.inputType} id={field.label} name={field.label} placeholder={field.placeholder} className="w-full px-4 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"/>:<textarea rows="5" id={field.label} name={field.label} placeholder={field.placeholder} className="w-full px-4 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"></textarea>);
}
